// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract LandRegistry {
    // Struct to store land details
    struct Land {
        uint256 landId;
        string ownerName;
        address ownerAddress;
        string location;
        uint256 price;
        bool exists;
    }

    // Mapping to store land details by land ID
    mapping(uint256 => Land) public lands;

    // Event for land registration
    event LandRegistered(uint256 indexed landId, string ownerName, string location, uint256 price);

    // Event for land ownership transfer
    event OwnershipTransferred(uint256 indexed landId, string newOwnerName, address newOwnerAddress);

    // Register a new land
    function registerLand(
        uint256 _landId,
        string memory _ownerName,
        string memory _location,
        uint256 _price
    ) public {
        // Ensure the land doesn't already exist
        require(!lands[_landId].exists, "Land already registered");

        // Register the land
        lands[_landId] = Land({
            landId: _landId,
            ownerName: _ownerName,
            ownerAddress: msg.sender,
            location: _location,
            price: _price,
            exists: true
        });

        // Emit an event for land registration
        emit LandRegistered(_landId, _ownerName, _location, _price);
    }

    // Transfer land ownership
    function transferOwnership(
        uint256 _landId,
        string memory _newOwnerName,
        address _newOwnerAddress
    ) public {
        // Ensure the land exists
        require(lands[_landId].exists, "Land does not exist");

        // Ensure the caller is the current owner
        require(lands[_landId].ownerAddress == msg.sender, "Only the owner can transfer ownership");

        // Update the land's owner details
        lands[_landId].ownerName = _newOwnerName;
        lands[_landId].ownerAddress = _newOwnerAddress;

        // Emit an event for ownership transfer
        emit OwnershipTransferred(_landId, _newOwnerName, _newOwnerAddress);
    }

    // Get land details by land ID
    function getLandDetails(uint256 _landId) public view returns (
        uint256 landId,
        string memory ownerName,
        address ownerAddress,
        string memory location,
        uint256 price
    ) {
        // Ensure the land exists
        require(lands[_landId].exists, "Land does not exist");

        // Return land details
        Land memory land = lands[_landId];
        return (land.landId, land.ownerName, land.ownerAddress, land.location, land.price);
    }
}
